// Compatibility type aliases for legacy code
export interface Hotel {
  id?: number | string;
  [key: string]: unknown;
}

export interface RoomType {
  id?: number | string;
  [key: string]: unknown;
}

export interface Room {
  id?: number | string;
  [key: string]: unknown;
}

export interface Tax {
  id?: number | string;
  [key: string]: unknown;
}

export interface Amenity {
  id?: number | string;
  [key: string]: unknown;
}

export interface User {
  id?: number | string;
  [key: string]: unknown;
}

// Compatibility interfaces for legacy code
export interface RatePlan {
  id: string | number;
  name: string;
  [key: string]: unknown;
}

export interface CancellationPolicy {
  id: string | number;
  name: string;
  [key: string]: unknown;
}

export interface BookingPolicy {
  id: string | number;
  name: string;
  [key: string]: unknown;
}

export interface OutboxOperation {
  id: string;
  status: string;
  type?: string;
  entity?: string;
  entityId?: string | number;
  error?: string;
  [key: string]: unknown;
}

export interface OutboxSummary {
  pendingOperations: number;
  failedOperations: number;
  syncedOperations: number;
  totalOperations?: number;
}

// Compatibility data exports
export interface AppData {
  hotel?: Hotel; // Legacy single hotel property
  hotels: Hotel[];
  roomTypes: RoomType[];
  rooms: Room[];
  ratePlans: RatePlan[];
  taxes: Tax[];
  amenities: Amenity[];
  users: User[];
  policies?: {
    cancellation?: CancellationPolicy[];
    booking?: BookingPolicy[];
  };
  outbox?: {
    operations: OutboxOperation[];
    summary: OutboxSummary;
    lastSyncAttempt?: string;
    lastSuccessfulSync?: string;
    totalOperations?: number;
  };
  lastModified?: string;
  version?: string;
}

export const DEFAULT_APP_DATA: AppData = {
  hotel: undefined,
  hotels: [],
  roomTypes: [],
  rooms: [],
  ratePlans: [],
  taxes: [],
  amenities: [],
  users: [],
  policies: {
    cancellation: [],
    booking: []
  },
  outbox: {
    operations: [],
    summary: {
      pendingOperations: 0,
      failedOperations: 0,
      syncedOperations: 0,
      totalOperations: 0
    }
  },
  lastModified: undefined,
  version: undefined
};

